import React from 'react';
import Card from './CardPair';

const CardList = ({ hbcUsers }) => {
  if (showFilter === 'SHOW-COFFEE') {
    return (
      <div className="flex justify-center flex-wrap">
        {
          hbcUsers.map((pairing, i) => {
            return (
              <Card giver={pairing[0]} key={i} receiver={pairing[1]}/>
            )
          })
        }
      </div>
    );
  } else if (showFilter === 'SHOW-ALL') {
    return (
      <div className="">
        HELLO
      </div>
    )
  }
}

export default CardList;
